import styled from "styled-components";

const WrapBox = styled.div`
  background: linear-gradient(to bottom, #000000, #4f4f51);
  background-size: cover;
  height: 100vh;
  max-width: 1600px;
  margin: 0 auto;
  padding-top:117.5px;
  z-index:2;
`;

export default WrapBox
